import React from "react";
import axios from "axios";
axios
  .get("https://picsum.photos/v2/list")
  .then(function (response) {
    // handle success
    response.data();
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  });
const Photos = () => {
  return <div></div>;
};

export default Photos;
